INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (1,'Sit on a bench holding a dumbbell in each hand with your palms facing inward:\n- Inhale and raise one arm at a time, turning the plum up\n- Raise your elbow to continue curling the dumbbell','MUSCULAR',NULL,'ARMS','Curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (2,'Sit on bench. Hold a dumbbell with an underhand grip and rest your elbow on the inner side of your thigh:\n- Inhale and curl the dumbbell\n- Exhale as you complete the movment','MUSCULAR',NULL,'ARMS','Concentration curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (3,'Stand or sit. Grasp a dumbbell in each hand with your palms facing inward:\n- Inhale and curl the dumbbells to your shoulders, either simultaneously or alternately\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Hammer curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (4,'Stand facing the machine and grasp the handle with an underhand grip:\n- Inhale and curl the pulley handle\n- Exhale as you complete the movment','MUSCULAR',NULL,'ARMS','Low pulley curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (5,'Stand between the pulleys, spread your arms, and grasp the high pulley handles with an underhand grip:\n- Inhale and curl the handles toward your head\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','High pulley curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (6,'Stand. Keep your back straight and take an underhand grip on the bar with your hands slightly more than shoulder-width apart:\n- Inhale, the curl the barbell\n- Contract the gluteal, abdominal and back muscles isometrically to avoid torso swing\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Barbell curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (7,'Sit and take an underhand grip on the bar with your arms straight and your elbows resting on the padded and angied surface of the table:\n- Inhale and curl the bar\n- Exhale as you complete the movment','MUSCULAR',NULL,'ARMS','Machine curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (8,'Stand or sit with your arms resting on the bench:\n- Inhale and curl the bar\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Preacher curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (9,'Stand with your feet slightly apart and your arms straight, using an overhand grip (thumbs toward each other): \n- Inhale and curl the bar\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Reverse curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (10,'Sit with your forearms resting on your thighs or on a bench. Take an overhand grip on the bar with your wrists passively flexed:\n- Curl your wrists back toward you\n- Return to the starting position','MUSCULAR',NULL,'ARMS','Reverse wrist curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (11,'Sit with your forearms resting on your thighs or on a bench. Take an underhand grip on the bar with your wrists passively flexed:\n- Inhale and curl your wrists up\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Wrist curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (12,'Stand facing the machine with your hands on the bar and your elbows against your sides:\n- Inhale and straighten your arms, but don\'t separate your elbows from your sides\n- Exhale as you complete the movment','MUSCULAR',NULL,'ARMS','Pushdowns');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (13,'Stand facing the machine with your hands on the bar and elbows fixed against your side:\n- Inhale and straighten your arms; don\'t separate your elbows from your sides\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Reverse pushdowns');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (14,'Stand facing the machine and grasp the handle with an underhand grip:\n- Inhale and straighten your arm\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','One-arm reverse pushdowns');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (15,'Lie on a flat bench and take an overhand grip on the bar with your arms extended:\n- Inhale and bend your elbows, making sure you don\'t allow them to flare to the sides\n- Return to the starting position, exhaling as you complete the movement','MUSCULAR',NULL,'ARMS','Triceps extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (16,'Lie on a flat bench holding a dumbbell in each hand with\nyour arms extended straight up from your shoulders:\n- Inhale and slowly bend your arms\n- Return to the starting position, exhaling as you complete the movement\n','MUSCULAR',NULL,'ARMS','Dumbbell triceps extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (17,'Stand or sit holding a dumbbell in one hand with your arm extended upward:\n- Inhale and blend your elbow to lower the dumbbell behind your neck\n- Return to the starting position, exhaling as you complete the movement','MUSCULAR',NULL,'ARMS','One-arm dumbbell triceps extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (18,'Sit holding the dumbbell in both hands behind your neck:\n- Inhale and extend your arms straight until they are above your hand\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Seated dumbbell triceps extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (19,'Stand or sit, taking an overhand grip on the bar with your arms extended upward:\n- Inhale and bend your elbows to lower the bar behind your neck\n- Return to the starting position, exhaling as you complete the extension','MUSCULAR',NULL,'ARMS','Seated ez-bar triceps extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (20,'Stand with your knees slightly fixed, bending forward at the waist, and keeping your back straight. Press your upper arm against your side. Bend your arm at a 90-degree angle:\n- Inhale and straighten your arm\n- Exhale as you complete the movement','MUSCULAR',NULL,'ARMS','Triceps kickbacks');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (21,'Place your hands on the edge of a flat bench and rest your feet on another bench. Assume a torso-leg angle of about 90 degrees:\n- Inhale and bend your arms\n- Straighten your arms to return to the starting point, exhaling as you complete the movement','MUSCULAR',NULL,'ARMS','Triceps dips');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (22,'Sit on a bench with your back straight. Grasp a barbell with an overhand grip and rest the barbell across your shoulders behind your neck:\n- Inhale and press the barbell directly above your head without arching your back \n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Back press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (23,'Sit with your back straight. Take an overhand grip on the barbell and rest in on your upper chest:\n- Inhale and press the barbell straight up\n- Exhale as the top of the movement','MUSCULAR',NULL,'SHOULDERS','Front press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (24,'Sit on a bench with your back straight. Grasp two dumbbells with an overhand grip and lift them to your shoulders, palms facing forward:\n- Inhale and press your arms to an extended vertical position\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Dumbbell press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (25,'Sit on a bench, grasp the dumbbells with an underhand grip, and lift them to your shoulders:\n- Inhale and alternately press your arms to an extended vertical position, rotating your wrist so your palm faces forward\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','One-arm dumbbell press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (26,'Stand with your feet slightly spread. Keep your back straight, your arms hanging at your sides, holding one dumbbell in each hand:\n- Raise the dumbbells to shoulder level, keeping your elbows slightly bent\n- Return to the starting position.','MUSCULAR',NULL,'SHOULDERS','Lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (27,'Stand with your feet spread apart and your knees slightly bent. Bend forward at the waist and keep your back straight. Hold the dumbbells with your elbows slightly bent:\n- Inhale and raise the dumbbells to your sides\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Bent-over lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (28,'Stand with your feet slightly apart. Hold the dumbbells with your palms down (overhand grip), resting the dumbbells on your thighs or slightly to your sides:\n- Inhale and alternate sides, raising the dumbbells forward to shoulder height\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Front raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (29,'Lie on your side on the floor or a bench, holding a dumbbell with an overhand grip:\n- Inhale and raise your arm\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Side-lying lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (30,'Grasp the handle with your arm at your side:\n- Inhale and raise your arm to shoulder height\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Low pulley lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (31,'Stand with your feet slightly spread. Hold the handle with an overhand grip, keeping your arms at your sides:\n- Inhale and raise your arm forward to shoulder height\n- Exhale as your complete the movement','MUSCULAR',NULL,'SHOULDERS','Low pulley front raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (32,'Stand with your feet spread and your knees slightly bent.  Bend forward at the waist, keeping your back straight and your arms hanging down. Hold a handle in each hand with the cables crossing each other:\n- Inhale and raise your arms to the sides until your hands are slightly above the level of your shoulders\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Low pulley bent-over lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (33,'Stand with your feet slightly spread. Keep your back straight and your abdominals contracted. Hold the dumbbell, palms facing in, with your hands overlapping each other. Rest the dumbbell on your thighs with your arms straight:\n- Inhale and raise the dumbbell forward until it reaches shoulder level\n- Slowly lower the dumbbell, making sure to avoid any jerky movements\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','One-dumbbell front raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (34,'Stand with your legs slightly spread. Take an overhand grip on the barbell and rest the barbell on your thighs. Keep your back straight and you abdominals contracted:\n- Inhale and raise the barbell forward with your arms straight until it reaches eye level\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Barbell front raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (35,'Stand with your feet slightly spread. Keep your aback straight. Take an overhand grip on the barbell with your hands slightly more then shoulder-width apart and resting on your thighs:\n- Inhale and pull the barbell upward close to your body until it reaches your chin, raising your elbows as high as possible\n- Slowly return to the arms-extended position, avoiding any jerky movements\n- Exhale as you complete the movement ','MUSCULAR',NULL,'SHOULDERS','Upright rows');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (36,'Sit on the machine\'s seat and grasp the handles:\n- Inhale and raise your elbows to shoulder level\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Nautilus lateral raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (37,'Sit in a pec deck machine facing forward its back support with your arms stretched out grasping the handles:\n- Inhale and force your elbows to the rear, pressing your scapulae together at the end of the movement\n- Exhale as you complete the movement','MUSCULAR',NULL,'SHOULDERS','Pec deck rear delt laterals');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (38,'Lie on your back on a flat bench. Keep your buttocks in contact with the bench and you feet flat on the floor:\n- Take an overhand grip on the barbell with your hand more then shoulder-width apart\n- Inhale and slowly lower the barbell until it reaches your chest\n- Press the weight back up, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Bench press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (39,'Lie on your back on a flat bench, keeping your buttock in contact with the bench and your feet on the floor. Take an overhand grip on the barbell with your hands from 4 to 15 inches apart, depending on your wrist flexibility:\n- Inhale and slowly lower the barbell until it reaches your chest, allowing your elbows to extend away from your torso\n- Press the barbell, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Close-grip bench press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (40,'Lie on incline bench set at an angle ranging between 45 and 60 degrees. Take an overhand grip on the barbell with your hands more than shoulder-width apart:\n- Inhale and lower the barbell until it reaches your jugular notch (upper chest at the base of your neck)\n- Press the back up to straight arms length, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Incline press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (41,'Lie on a decline bench set at an angel between 20 and 40 degrees with your feet anchored to prevent them from slipping. Take an overhand grip on the bar with your hands at least shoulder-width apart:\n- Inhale and slowly lower the bar until it reaches the lower edge of your pectorals\n- Press the back up to straight arms length, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Decline press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (42,'Lie prone with your arms straight, your palms flat on the floor, and your hands shoulder-width apart (or wider). Hold your feet together or very slightly spread:\n- Inhale and bend your elbows to bring your torso near the floor, avoiding extreme hyperextension of your spine\n- Push yourself back to an arms-extended position, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Push-ups');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (43,'Support yourself with your arms straight and your torso hanging down from your shoulders:\n- Inhale and bend your elbows to allow your body to sink as far down between the bars as possible\n- Reverse the motion and return to the starting point, exhaling as you complete the movement','MUSCULAR',NULL,'CHEST','Parallel bar dips');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (45,'Lie flat on the bench with your feet on the floor for stability, your arms extended upward, and your hands facing in loward each other holding the dumbbells:\n- Inhale and lower the dumbbells to chest level, bending your elbows and rotating your forearms to bring your hands in pronation\n- Press the dumbbells back up and do an isometric contraction to isolate the stress on the upper pectorals; exhale as you complete the movement','MUSCULAR',NULL,'CHEST','Dumbbell press chest');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (46,'Lie flat on a narrow bench to allow free movement of your shoulder. Hold the dumbbells with your arms extended and your elbows slightly bent to lessen the stress on the joint:\n- Inhale, then lower the dumbbells until your elbows are at shoulder height\n- Raise the dumbbells back up while exhaling\n- Perform a short isometric contraction at the end of the movement to place more focus on teh upper pectorals (sternal part)','MUSCULAR',NULL,'CHEST','Dumbbell flys');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (47,'Lie on an incline bench (set at an angle less then 60 degrees to avoid placing to much emphasis on the deltoids) with your elbows bent. Hold the dumbbells with an overhand grip:\n- Inhale and extend your arms until the weights touch\n- Exhale as you complete the movement','MUSCULAR',NULL,'CHEST','Incline dumbbell press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (48,'Lie on an incline bench set at an angle between 45 and 60 degrees. Hold the dumbbells with your arms extended or slightly bent to lessen the stress on the elbow joint:\n- Inhale, then lower the dumbbells until your elbows are at shoulder height\n- Raise the dumbbells while exhaling','MUSCULAR',NULL,'CHEST','Incline dumbbell flys');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (49,'Sit on the machine\'s seat and press your elbows into the pads, relaxing your forearms and wrists:\n- Inhale and force the pads together until they touch in front of your chest\n- Exhale as you complete the movement','MUSCULAR',NULL,'CHEST','Pec deck flys');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (50,'Stand with your feet slightly spread, your body slightly forward, and your elbows slightly bent. Hold the handles with your arms spread:\n- Inhale and press the cable handles forward until your hands touch \n- Exhale as you complete the contraction','MUSCULAR',NULL,'CHEST','Cable crossover flys');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (51,'Lie on the bench, with your feet on the floor. Hold a dumbbell with both hands, palms against the underside of the upper set of plates, thumbs and forefingers encircling the handle:\n- Inhale as you lower the weight behind your head, slightly bending your elbows\n- Return to the starting position, exhaling','MUSCULAR',NULL,'CHEST','Dumbbell pullovers');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (52,'Extend your arms and take an overhand grip on the barbell with your hands shoulder-width apart:\n- Inhale, filling your lungs, as you lower the barbell behind your head, bending your arms slightly\n- Exhale as you return to the starting positon','MUSCULAR',NULL,'CHEST','Barbell pullovers');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (53,'Extend your arms and take a wide, overhand grip on a chinning bar:\n- Inhale and pull yourself upward until your eyes are above the level of the bar\n- Exhale as you complete the movement','MUSCULAR',NULL,'BACK','Chin-ups');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (54,'Sit facing the machine and wedge your knees under the restraint pad provided. Take a very wide overhand grip on the bar:\n- Inhale and pull the bar down to your upper chest, arching your back and bringing your elbows back\n- Exhale as you complete the movement','MUSCULAR',NULL,'BACK','Lat pulldowns');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (55,'Sit facing the machine and wedge your knees under the restraint pad. Grip the handles with your palms facing toward each other:\n- Inhale and pull the handle down to touch the upper part to your chest, arching your back and slightly tilting your upper body backward\n- Exhale as you complete the movement','MUSCULAR',NULL,'BACK','Close-grip lat pulldowns');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (56,'Sit facing the machine. Place your feet against the foot stops and lean toward the pulley:\n- Inhale and pull the handle until it touches your lower rib cage, arching your back\n- As you pull the handle toward your torso, be sure your elbows travel as far backward as possible\n- Exhale as you complete the movement','MUSCULAR',NULL,'BACK','Seated rows');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (57,'Stand with your knees slightly flexed. Bend your torso at an angle of about 45 degrees, keeping your back straight. Take an overhand grip on the bar with your hands more than shoulder-width apart and your arms dangling straight down from your shoulders:\n- Inhale, contract your abdominals isometrically, and pull the bar straight up until it touches your chest\n- Return to the starting position, exhaling','MUSCULAR',NULL,'BACK','Bent rows');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (58,'Stand with your feet placed fairly close to each other, facing the bar on the floor. Bend forward at the waist, keeping your back arched and, if possible, your legs straight. Take an overhand grip on the bar, with your arms relaxed:\n- Inhale and straighten your body, flexing at the hips and keeping your back rigid\n- Exhale as you complete the movement and return the bar back to the floor, keeping your back straight','MUSCULAR',NULL,'BACK','Stiff-legged deadlifts');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (59,'Stand facing the bar. Place your feet considerably wider than shoulder-width apart with your toes pointing outward, keeping them in line with your knees:\n- Flex your knees until you thighs are parallel to the floor\n- Take an overhand grip on the bar with your hands about shoulder-width apart, keeping your arms straight (use an over-under grip to lift heavier loads)\n- Inhale, hold your breath, slightly arch your back, shoulders backward, contract your abdominals and straighten your legs, extending your torso to stand erect. Exhale.','MUSCULAR',NULL,'BACK','Sumo deadlifts');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (60,'Lie face down on the Roman chair with the ankle supports (tihia pads) properly adjusted and your hips on the support pads:\n- Start with your thights flexed and raise your upper body to a position parallel to the floor \n- Be sure to assume the proper arched position to reduce the chance of injury to the lower back  ','MUSCULAR',NULL,'BACK','Back extension');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (61,'Stand with your feet slightly apart. Keep your hands straight or slightly bent forward. Hold the dumbbells with your arms extended at your sides:\n- Shrug your shoulders as high and as far back as possible\n- Lower the dumbbells back to the starting point','MUSCULAR',NULL,'BACK','Dumbbell shrugs');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (62,'Stand with your feet slightly apart and grasp a dumbbell in each hand with your arms hanging down at your sides:\n- Look straight ahead, inhale, slightly arch your back and squat down\n- Once your thighs are parallel to the floor, straighten your legs to return to the starting position\n- Exhale as you complete the movement','MUSCULAR',NULL,'LEGS','Dumbbell squats');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (63,'Position the barbell across your anterior deltoids, hold your upper arms parallel to the floor, bend your elbows, cross your forearms, grasp the bar and look straight ahead:\n- Inhale and squat down\n- Return to the starting position, exhale as you complete the movement','MUSCULAR',NULL,'LEGS','Front squats');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (64,'Sit on the machine, lying back against the angled back pad, and place your feet about shoulder-width apart:\n- Inhale, rotate the stop bars at the sides of your hips to release the carriage for your set\n- Bend your legs as much as possible while making sure your knees travel to the sides of your chest\n- Return to the starting position, exhaling as you complete the movement','MUSCULAR',NULL,'LEGS','Angled leg press');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (65,'Sit on machine. Grasp either the handles or the edges of the seating platform to steady your body throughout the movement. Bend your knees and place your ankles under the set of roller pads:\n- Inhale and raise your legs until they are almost parallel to the floor\n- Exhale as you complete the movement','MUSCULAR',NULL,'LEGS','Leg extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (66,'Stand in the machine so your knee is pressed against the movable pad. Hook your ankle under the roller pad, straighten your leg, and grasp the machine to restrain your upper body as you do the movement:\n- Inhale and bend your knee\n- Exhale as you complete the movement','MUSCULAR',NULL,'LEGS','Standing leg curls');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (67,'Stand with your feel slightly apart. Place a barbell across your trapezius muscles or a little lower across your posterior deltoids:\n- Inhale and bend forward at the waist until your torso is roughly parallel to the floor, being sure to keep your back straight\n- Return to the starting position, exhaling','MUSCULAR',NULL,'LEGS','Good mornings');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (68,'Fasten the cuff or your ankle and grasp a fixed part of the machine with your opposite hand for support:\n- Bring your leg attached to the cable toward and then across the other leg\n- Return to the starting position','MUSCULAR',NULL,'LEGS','Cable adductions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (69,'Stand on one foot, placing the toe and ball of your foot on the toe block. Hold a dumbbell in your hand on the same side as the foot you are standing on a grasp the edge of machine with your other hand to steady your body in position throughout the movement.\n- Rise up as high as you can on your toes (plantarflexion), keeping your knee extended or very slightly bent\n- Return to the starting position','MUSCULAR',NULL,'LEGS','One-leg toe raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (70,'Sit on machine\'s seat and place the restraint pads tightly across your thighs. Place your toes and the balls of your feet on the foot bar:\n- Stretch your heels as far below the level of your toes as possible (dorsiflexion)\n- Rise up as high as you can under resistance on your toes (plantarflexion)','MUSCULAR',NULL,'LEGS','Seated calf raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (71,'Stand with your feet hip-width apart. Lift a light barbell up to a position across your shoulders behind your neck:\n- Inhale and take a comfortable step forward, keeping your torso as upright as possible\n- In the bottom position, the top of your forward thigh is slightly below parallel\n- Return to the starting position, exhaling','MUSCULAR',NULL,'BUTTOCKS','Lunges');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (72,'Attach a cuff to the end of the cable running through the low pulley. Fasten the cuff around your ankle. Stand in front of the weight stack and grasp the edge of the machine for the support:\n- Tilt your pelvis forward\n- Bring your leg back','MUSCULAR',NULL,'BUTTOCKS','Cable back kicks');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (73,'Grasp the handles of the machine, place one foot on the footplate and bring your opposite leg slightly forward, with the pad halfway between knee joint and ankle. Bend forward slightly:\n- Inhale and move your thigh to the rear until you hip is fully extended backward (hyperextension)\n- Hold this peak contracted position for 2 seconds and return to the starting position\n-- Exhale as you complete the extension','MUSCULAR',NULL,'BUTTOCKS','Machine hip extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (74,'Kneel on one leg with your elbows of hands on the floor and your forearms straight:\n- Tuck your opposite leg under your chest\n- Move your tucked leg to the rear until your hip i fully exxtended','MUSCULAR',NULL,'BUTTOCKS','Floor hip extensions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (75,'Lie on the floor with your entire spine in contract with the floor. Place your hands on the floor next to your hips. Flex your knees to 90 degrees:\n- Lift your buttocks off the floor, pushing your feet as high as you can\n- Hold the position for 2 seconds and lower your pelvis without putting your buttocks back on the floor\n- Immediately repeat','MUSCULAR',NULL,'BUTTOCKS','Bridging');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (76,'Attach a low pulley to your ankle:\n- Grasp the edge of the machine with your opposite hand to stabilize your body.\n- Raise lateraly your leg as far as you can.','MUSCULAR',NULL,'BUTTOCKS','Cable hip abductions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (77,'Place one foot on the footplate and place the outer side of your other leg against the pad below your knee (close to your ankle):\n- Move this leg as high to the side as possible\n- Note the abduction is limited because the neck of the femur (thigh bone) is rapidly stopped on the rim of the cup into which the femur fits at the pelvis','MUSCULAR',NULL,'BUTTOCKS','Standing machine hip abductions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (78,'Lie on your side with your head and shoulders in line:\n- Lift your leg to an angle of 70 degrees (at the most) of the floor, always keeping your knee extended \n- Return to the starting position and repeat','MUSCULAR',NULL,'BUTTOCKS','Floor hip abductions');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (79,'Lie on your back. Place your hands behind your head. Flex your hips and knees to a 90 degrees angle:\n- Inhale and lift shoulders off the floor, moving your knees closer to your head by shortening your torso\n- Exhale as you complete the movement','MUSCULAR',NULL,'ABDOMEN','Crunches');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (80,'Lie on your back with your legs bent and your feet on the floor. Place your hands behind your head:\n- Inhale and curl your torso off the floor\n- Exhale as you complete the movement\n- Return to the starting position without resting your torso on the floor','MUSCULAR',NULL,'ABDOMEN','Sit-ups');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (81,'Sit on the bench and hook your feet under the roller pads. Place your hands behind your neck:\n- Inhale and incline your torso less then 20 degrees\n- Move your torso back up, slightly curling your torso to place more stress on the rectus abdominis\n- Exhale as you complete the movement','MUSCULAR',NULL,'ABDOMEN','Incline bench sit-ups');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (82,'Kneel down with the bar behind your neck:\n- Inhale and shorten your torso to move your chest toward your things\n- Exhale during the performance','MUSCULAR',NULL,'ABDOMEN','High pulley crunches');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (83,'Lie on your back on an incline abdominal board and grasp the rungs:\n- Move your feet until they are directly above your hips\n- Raise your hips by shortening your torso, trying to touch your head with your knees','MUSCULAR',NULL,'ABDOMEN','Incline leg raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (84,'Take an overhand grip on a chin-up bar. Hang straight.\n- Inhale and raise your knees as high as possible, being sure to move your knees to your chest by shortening your torso\n- Exhale as you complete the movement','MUSCULAR',NULL,'ABDOMEN','Hanging leg raises');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (85,'Stand with your feet slightly apart. Place your left hand behind your neck, holding a dumbbell in your right hand:\n- Bend your torso to the left side\n- Return to the starting position, or move slightly farther to the other side by bending at the waist passively','MUSCULAR',NULL,'ABDOMEN','Dumbbell side bends');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (86,'Stand on the swivel plate and hold handles:\n- Twist your hips from one side to the other being sure to keep your shoulders stationary throughout the movement\n- Bend your knees slightly, make sure you perform this movement under control','MUSCULAR',NULL,'ABDOMEN','Machine trunk rotations');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (87,'Stretch your right upper arm forward and bend the handle. Grasp the right hand with the left hand and slowly pull it towards the body, as if you want to push the right hand towards the front of the forearm. Keep your elbow in a stretched position at all times.','STRETCHES',NULL,'ARMS','Stretching the handle extensor muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (88,'Extend your right upper arm in front of your body with your palm facing forward. Grasp your right fist with your left and push your right upper arm toward your body, as if trying to touch your forearm with your upper arm and push your right palm forward.','STRETCHES',NULL,'ARMS','Stretching the handle flexor muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (89,'Take a sitting or standing position with your back straight. Raise one arm vertically, parallel to the head, and bend the elbow at a 90-degree angle.\n- Try to place your elbow above your head\n- Hold the stretched position for a few seconds by breathing lightly.','STRETCHES',NULL,'ARMS','Stretching of the triceps muscle of the upper arm');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (90,'Take a standing position with your feet hip-width apart and your hands behind your back, accepting one fist to the other. Push your arms as far back as possible and then gradually raise them while simultaneously pushing your chest forward and pulling your forehead down and back.','STRETCHES',NULL,'SHOULDERS','Stretching of the anterior segment of the deltoid muscle');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (91,'Take a standing position and rest your dumbbell with one fist with your torso tilted forward, while leaning on the trainer. With your upper arm fully extended, allow the dumbbell to hang as you relax your shoulder muscles.','STRETCHES',NULL,'SHOULDERS',' Stretching the rotator cuff muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (92,'Take a standing position and raise one arm in front of you to eye level. Grasp the elbow of the raised hand with the opposite fist and gently pull the hand towards the torso so that the elbow of the outstretched hand almost touches the opposite shoulder.','STRETCHES',NULL,'SHOULDERS','Stretching the shoulder muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (93,'Take a standing position with the upper arm outstretched with one hand. Grasp the support with the outstretched hand and gently rotate the chest towards the opposite side, moving away from the points of support.\n','STRETCHES',NULL,'CHEST',' Stretching of the pectoralis major muscle');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (94,'Take a standing position with your feet slightly apart:\n- Tilt your chest forward. With your upper arms outstretched, grasp with both hands a stable support such as a trainer or a Smith cage frame.\n- Place the palm of the upper hand in a higher position. Keeping the upper arms outstretched, you simultaneously push the support with your upper hand as hard as possible and pull the support point with your lower hand.\nTo increase the intensity of stretching the broad back and large muscle lining, rotate the chest trying to lift the left shoulder.','STRETCHES',NULL,'BACK',' Stretching of the broad back and large muscle lining');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (95,'\nPlace yourself in a hanging position on the shaft with a wide grip (thumbs facing each other):\n- Inhale and exhale very slowly, concentrating on relaxing the whole body, which allows the back muscles to stretch\n- When you are completely relaxed, lower your head forward, trying to touch your chest with your chin.','STRETCHES',NULL,'BACK','Stretching the back in a hanging position');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (96,'Take a standing position with your feet slightly apart and your back straight. Place one hand behind your back and grasp the handle of that hand with the other hand. Gradually pull your arm down and inward to feel the stretching of the deltoid and ciliary muscles.','STRETCHES',NULL,'BACK','Stretching of the deltoid and trapezius muscles and neck muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (97,'Place the palm of one hand over the head and gradually push the head down (lateral flexion or deflection).\n','STRETCHES',NULL,'BACK','Stretching of the trapezius muscle and neck muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (98,'The classic stretching exercise practiced by many power-lifting practitioners involves a deep squat while accepting a stable support with both fists, such as an exercise shaft or a neck frame.','STRETCHES',NULL,'LEGS','Stretching in the squat position');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (99,'\nStand on one leg:\n- Accept the foot or ankle of the other leg\n- Try to pull the foot up, touching the buttocks with the heel.','STRETCHES',NULL,'LEGS','Stretching of the quadriceps femoris');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (100,'Take a standing position, bend one leg slightly at the knee and stretch the other, keeping the foot in the position of dorsal flexion (flexion):\n- Place your palms on your thighs and stretch your back slightly. Bend your torso forward and focus on the feeling of stretching the back of the thigh. Hull flexion takes place in the hips.\n- Gradually return to the starting position.','STRETCHES',NULL,'LEGS','Stretching the muscles of the back of the thigh');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (101,'Take a standing position and place your hands on your hips, step out with one leg and stretch with the other, keeping both feet level with your knees:\n- Bend the knee of the front leg by pressing the pelvis down, while keeping the back leg in a stretched position with the heel on the ground.\n- Hold this position until you feel a stretch in the hind leg sheet.','STRETCHES',NULL,'LEGS','Stretching the muscles of the back of the lower leg');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (102,'Lie on your back with your legs outstretched on the floor:\n- Grasp one upper leg with both hands, bend the knee and gently pull it towards the chest\n- Hold the set position, breathe slowly and try to feel the stretching of the large gluteal muscle.\n- Return to the basic position and repeat the exercise with the other leg.','STRETCHES',NULL,'BUTTOCKS','Stretching the large buttocks and the muscles of the back of the thigh');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (103,'Take a sitting position on the ground floor with one leg outstretched and the other bent at the knee and cross over the lower leg, resting the foot on the ground. Push the inward bent leg at the knee with the elbow of the opposite hand.\n','STRETCHES',NULL,'BUTTOCKS','Stretching the seat box');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (104,'Take a standing position with your feet set at a width greater than the width of your hips and stretch your back:\n- Extend both arms vertically, cross the fingers of both hands and turn the palms upwards.\n- Inhale and expand the chest by stretching the intercostal muscles. Keep your back and head in a straight position.\n- Exhale very slowly as you relax and repeat the exercise.','STRETCHES',NULL,'ABDOMEN','Stretching the upper half of the body');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (105,'\nLie on your stomach and stretch your upper arms leaning on your fists:\n- Gradually lift the torso by gently tilting your head back.\n- Hold the position for a few moments, breathe slowly and feel the stretching of the front abdominal wall.','STRETCHES',NULL,'ABDOMEN','Stretching of the abdominal muscles');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (106,'\nRun at a fast pace','AEROBIC','VIGOROUS',NULL,'Running');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (107,'Cycling fast','AEROBIC','VIGOROUS',NULL,'Cycling');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (108,'Run at a moderate pace','AEROBIC','MODERATE',NULL,'Moderate runnig');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (109,'Cycling at a light-moderate pace\n','AEROBIC','MODERATE',NULL,'Moderate cycling');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (110,'Walk at a fast pace\n','AEROBIC','MODERATE',NULL,'Fast walking');
INSERT INTO `trinsi`.`exercise` (`id`,`description`,`exercise_type`,`intensity`,`muscles_group`,`name`) VALUES (111,'Walk at your own pace','AEROBIC','LIGHT',NULL,'Walking ');
